Sing kung chok tse yee:Ngor but mai sun, ngor mai chi gung/True Women for Sale(2008)


Year:2008	 

Director:Herman Yau Lai-To

Producer:Ng Kin-Hung	

Writer:	Yang Yee-Shan, Herman Yau Lai-To

Cast:	
Anthony Wong Chau-Sang, Prudence Lau Mei-Kwan, Race Wong Yuen-Ling, Sammy, Monie Tung Man-Lei, Sherming Yiu Lok-Yi, Chapman To Man-Chat, Jessey Meng, Fung Hak-On, Toby Leung Ching-Kei, Siu Yam-Yam, Yung-Yung Yu, Siu Fei, Yumiko Cheng Hei-Yi, Louis Cheung Kai-Chung, Jackie Ma Hok-Ming, Derek Kwok Chi-Kin

The Skinny:	
Both preachy and personal, True Women For Sale is very Hong Kong and very Herman Yau. The film is probably tough going for audiences without knowledge of Hong Kong's cultural or social issues, but it's got both intelligence and personality, and is worthy simply as an uncommon look at local Hong Kong lives.
